import './App.css';
import Navbar from './component/Navbar';
import Home from './component/Home';
import {Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">

        <Navbar />
        <div>
          <Routes>
            <Route path='/component/' element={<Home/>}/>
            <Route path='/component/Create' element={<Home/>}/>
            <Route path='/component/Contact' element={<Home/>}/>
          </Routes>
        </div>


    </div>
  );
}

export default App;
